  <style>
    * {
      font-size: 98.87% !important;
      line-height: 127.36% !important;
    }

    .mpest-popup {
      position: fixed;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      z-index: 999999
    }

    body,
    html {
      background-color: #000;
      height: 100%
    }

    body {
      color: #fff;
      font: 400 14px Helvetica, Roboto, Arial, Tahoma, sans-serif;
      margin: 0
    }

    .w {
      display: flex;
      flex-direction: column;
      min-height: 100%;
      max-width: 640px;
      margin: 0 auto
    }

    .h__tx {
      background-color: #0e0e0e;
      color: #ff9000;
      font-size: 12px;
      font-weight: 700;
      padding: 6px 5px;
      text-align: center
    }

    .h__c {
      align-items: center;
      display: flex;
      justify-content: space-between;
      padding: 10px
    }

    .h__m-ic,
    .h__s-ic {
      fill: #ff9000;
      border: 1px solid #ff9000;
      border-radius: 4px;
      width: 1em;
      height: 1em;
      padding: .33em
    }

    .cnt__inner {
      display: flex;
      flex-direction: column;
      flex-grow: 1
    }

    .cnt__inner {
      background: #292929 linear-gradient(180deg, #292929, #1b1b1b);
      border-radius: 16px;
      margin: 10px;
      max-width: 620px;
      padding: 7px 10px 10px
    }

    .cnt__t {
      font-size: 18px;
      font-style: italic;
      font-weight: 700;
      line-height: 1
    }

    .pl {
      background-color: #343434;
      border: 1px solid #292929;
      border-radius: 10px;
      display: flex;
      flex-grow: 1;
      margin-top: 10px;
      min-height: 212px;
      padding: 10px
    }

    .pl__cnt {
      background-color: #000;
      background-size: contain;
      background-position: center center;
      background-repeat: no-repeat;
      flex-grow: 1
    }

    .pl__cnt {
      align-items: center;
      display: flex;
      justify-content: center;
      position: relative
    }

    .pl__ctr {
      align-items: center;
      bottom: 0;
      display: flex;
      height: 50px;
      position: absolute;
      width: 100%
    }

    .pl__ctr-tm {
      font-size: 11px;
      margin: 0 20px 0 15px
    }

    .pl__ctr-bar {
      background-color: #3f3f3f;
      flex-grow: 1;
      height: 2px;
      margin-right: 15px;
      position: relative
    }

    .pl__ctr-bar:before {
      background-color: #fff;
      border-radius: 50%;
      content: "";
      cursor: pointer;
      height: 16px;
      left: -8px;
      position: absolute;
      top: -8px;
      width: 16px;
      z-index: 1
    }

    .pl__ctr-bar-line {
      -webkit-animation: a 5s both;
      animation: a 5s both;
      background-color: #9f9f9f;
      height: 100%;
      left: 0;
      position: absolute;
      transform-origin: left;
      width: 85%
    }

    .pl__ctr-ic {
      cursor: pointer;
      fill: #fff
    }

    .pl__ctr-ic.hd {
      background-color: #000;
      border-radius: 4px;
      fill: #b6d4f0;
      height: 16px;
      width: 33px
    }

    .pl__ctr-ic.mute {
      height: 14px;
      margin: 0 15px
    }

    .pl__ctr-ic.resize {
      height: 18px;
      margin-right: 15px
    }

    .info {
      background: #1b1b1b linear-gradient(180deg, #1b1b1b, #292929);
      border-radius: 10px;
      justify-content: space-between;
      padding: 10px
    }

    .info {
      align-items: center;
      display: flex
    }

    .lst__t {
      font-size: large;
      font-weight: 700;
      padding: 0 10px
    }

    .lst__w-i {
      display: flex;
      padding: 0 5px
    }

    .lst__i {
      background: #292929;
      border-radius: 4px;
      margin: 5px;
      padding: 7px;
      width: 100%
    }

    .lst__i-img {
      padding-top: 56.07843137254902%;
      background-size: 100%
    }

    .lst__i-img.i-1 {
      background-position: 0 0
    }

    .lst__i-img.i-2 {
      background-position: 0 33.333%
    }

    .lst__i-img.i-3 {
      background-position: 0 66.666%
    }

    .lst__i-img.i-4 {
      background-position: 0 99.999%
    }

    @keyframes a {
      0% {
        transform: scaleX(0)
      }

      to {
        transform: scaleX(.85)
      }
    }

    @media (min-width:650px) {
      .h__tx {
        font-size: 14px
      }
    }
  </style>
</head>
